module.exports = "<div class=\"ui stackable no-margin main-content__no-logged\" *ngIf=\"isLarge\">\n    <div class=\"ui large stackable secondary pointing menu nomobile grid main-content__no-logged__banner no-margin\">\n      <div class=\"main-content__no-logged__banner__left\">\n        <a href=\"/auth/landing/\">\n          <img class=\"ui spaced image main-content__no-logged__banner__logo\" src=\"/assets/images/LogoMO.png\">\n        </a>\n        <div class=\"main-content__no-logged__banner__itemMenu\" (click)=\"scroll2('works')\">\n          <a routerLinkActive=\"active-active\" \n          class=\"item main-content__no-logged__banner__menu-option\">\n            Home\n          </a>\n        </div>\n      </div>\n      <div class=\"main-content__no-logged__banner__right\">\n        <div class=\"main-content__no-logged__banner__right__item\">\n          <button class=\"button__landing__banner__login\" (click)=\"goToLogin()\">\n            LOG IN\n          </button>\n        </div>\n        <div class=\"main-content__no-logged__banner__right__item\">\n          <button class=\"button__landing__banner__request\" (click)=\"request()\">\n            REQUEST CASH\n          </button>\n        </div>\n      </div>\n    </div>\n  <div class=\"faq\" *ngIf=\"isLarge\">\n    <div class=\"faq__header ui column row grid no-margin\">\n        <div class=\"two wide column\"></div>\n        <div class=\"six wide column\">\n          <div class=\"faq__header__title\">\n              Frequently Asked Questions\n          </div>\n          <div class=\"faq__header__text\">\n              Sounds great because it is!\n          </div>\n          <div class=\"faq__header__button\">\n          <button class=\"button__landing__banner__request-big2\" (click)=\"request()\">\n              REQUEST CASH\n          </button>\n          </div>\n        </div>\n        <div class=\"six wide column\">\n          <div class=\"faq__header__image\">\n          <img class=\"faq__header__image__pic\" src=\"/assets/images/faqcoins.png\">\n          </div>\n        </div>\n        <div class=\"two wide column\"></div>\n    </div>\n    <div class=\"faq__body ui grid\">\n        <div class=\"three column row faq__body__columns\">\n          <div class=\"column\">\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    What is MO?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    We are one of the fastest growing Fintech worldwide and we aim at \n                    revolutionizing the credit scoring industry & promoting financial \n                    inclusion, by giving small businesses the possibility to access \n                    fast cash independent from their credit history.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    How do I change my business bank account?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    If you would like to change your business bank account contact us at \n                    help@motechnologiesusa.com.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    Where can I review my payments?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    Login to review your historical payments, upcoming payments and preview payments \n                    for a new cash request.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    What if I don’t have enough money in my business bank account to pay an installment?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    If an installment payment is missed due to insufficient funds, we will attempt to \n                    withdraw again the following day. A penalty of $10 will be added to your last \n                    payment for each missed installment payment.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    How do I apply?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      Applying is fast and easy.  First, we ask for basic information about your business.  \n                      Thereafter, we ask you to securely connect to your business bank account so we can \n                      analyze your business performance and automatically approve you for the maximum cash \n                      amount. \n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    Who funds my cash request?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    Who funds my cash request? \n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      How quickly can I get my funds?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      If you make a cash request before 11:00am EST during a business day, funds will \n                      be deposited into your linked business bank account the same day. Otherwise, you \n                      shall receive the funds the next business day.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      How do you use my business bank account information?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      Reviewing your business banking activity gives us a full picture of your business \n                      in real time without requiring you to submit paperwork. Your account will remain \n                      connected to MO not just at the time of application, but also on an ongoing basis \n                      so you don't have to reapply or reenter your information. Our persistent data \n                      connectivity keeps you eligible for promotional offers and ensures we approve you \n                      for the maximum cash amount based on your most recent business activity.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      How secure is my information?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      Security is our priority and we follow the required information security practices \n                      to maintain the integrity of your information. We can never see or store bank/data \n                      source login information, and we have no access to save or change your bank account \n                      data. For more information, review our Privacy Policy.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      Does you sell my information to third parties?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      We never sell your data to third parties. Your information is strictly used to help \n                      us best serve you.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n\n          </div>\n          <div class=\"column\">\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    Why do small businesses use MO Instant Cash?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    Every business needs additional working capital to grow their businesses in \n                    countless ways, from marketing campaigns to purchasing inventory to hiring \n                    new employees.  Check 13 ways you can use MO Instant Cash to show your business \n                    some love.\n                </div>\n                <div class=\"faq__body__columns__card__button\">\n                    <button class=\"button__landing__banner__download faq__body__columns__card__button__button\" (click)=\"open()\">\n                      Check here\n                    </button>\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      How do installment payments work?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    We simplify your payments by automatically withdrawing 22 equal installments from \n                    your business bank account.  Installment payments will begin 5 business days after \n                    we deposit your cash request.  We ask your bank to deduct installment payments \n                    during business days only.  So you have a little over a month to pay back the debt \n                    considering we ask the bank not to deduct installments during weekends and holidays. \n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    Can I make an early payment?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    Early payments will be handled on an exception basis. If our Customer Service approves \n                    you for an early payment, you are still responsible to pay the entire 4.99% service \n                    charge. If you are interested in an early payment, contact us at \n                    help@motechnologiesusa.com.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    What does it cost to apply?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    It’s 100% free and it does not negatively impact your credit score.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    Who is eligible to request cash through MO?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    Approval requires verification of your business information, your business bank \n                    account and a minimum sale of $1,000 each month for the three past months\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      What information and verification do you need from my business?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    Tax ID or EIN, business zip code, business bank account, e-mail or phone number \n                    associated with your business bank account.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      Can I reapply if I'm not qualified?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      Considering we approve you for a cash request based on your business performance, \n                      we recommend reapplying only after your business has experienced positive sales growth.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      How can I increase my chances of qualifying?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      MO looks at your business financial performance to determine the maximum cash you \n                      can request. The more sales you're able to show, the better chance you have of \n                      qualifying. Make sure you link the business bank account that contains the majority \n                      of your sales transactions to improve your likelihood of qualification.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      Why do you need my business bank account information?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      Unlike other merchant funding companies, we only look at your business banking \n                      activity to ensure we provide you the maximum cash approval decision. Logging \n                      into your business bank account shows us how you make and spend money.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      Where is MO located?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      We are headquartered in Miami, Florida.  Contact us at help@motechnologiesusa.com.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              \n          </div>\n          <div class=\"column\">\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    What account do you deposit my cash request and withdraw payments form?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    During the application process we ask you to link your business bank account, \n                    which we use, as your primary payment account. Your primary payment account \n                    is the account we deposit your cash requests and withdraw installment payments \n                    from.   \n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    How is my payment amount determined?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    The daily amount deducted will be made up of your requested cash amount plus a \n                    one-time 4.99% service charge, divided by 22 installments.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                    When do payments post to my business bank account?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    Installment payments will begin 5 business days after we deposit your cash request.  \n                    We ask your bank to deduct installment payments during business days only.  \n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      What fees are charged for a cash request?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      A one-time 4.99% service charge shall be added to the cash request amount to cover \n                      money transferring and order processing fees.    \n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      What if I can’t find my bank in the list of banks provided?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      We use 3rd party data provider Plaid to securely connect to your financial \n                      institution. If you cannot find your bank in the list of banks provided \n                      it’s simply because Plaid does not support connectivity to your bank and as \n                      such we will not be able to extend you a cash request until Plaid provides \n                      us the capability to connect to your bank.  To request for your bank to be \n                      added to Plaid list of banks contact us at help@motechnologiesusa.com.     \n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      How long does it take to be approved?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      The application and approval process only takes a few minutes.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      How do you determine how much cash I can request?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      We use modern technology to review the financial performance of your business.  \n                      We then crunch some numbers and share the maximum cash amount we can provide you.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      If I own multiple businesses, can I open multiple MO accounts?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                    If you own multiple businesses, you can open multiple MO accounts as long as each \n                    business has its own unique business bank account.  You cannot link the same business \n                    bank account to multiple MO accounts.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              <div class=\"faq__body__columns__card\">\n                <div class=\"faq__body__columns__card__title\">\n                      What do you do with my business bank login credentials?\n                </div>\n                <div class=\"faq__body__columns__card__text\">\n                      We use a 3rd party data provider Plaid to securely connect to your financial \n                      institution. We never store your login credentials and only maintains the \n                      account connection through Plaid.\n                </div>\n                <div class=\"faq__body__columns__card__division\">\n                    <img class=\"faq__body__columns__card__division__pic\" src=\"/assets/images/division.png\">\n                </div>\n              </div>\n              \n          </div>\n        </div>\n    </div>\n  </div>\n</div>\n\n<ng-template let-context let-modal=\"modal\" #modalInfo>\n  <div class=\"header header-modal modalFAQ__header\">13 ways you can use MO Instant Cash</div>\n  \n  <div class=\"ui fluid text center aligned content-modal align-center\">\n      <button class=\"button__landing__banner__download\" \n      (click)=\"modal.approve('approved')\" style=\"margin-top: 2rem;\" autofocus>\n        Done\n      </button>\n      <div class=\"ui hidden divider\"></div>\n  </div>\n</ng-template>"

